import React from "react";
import breakpoint from '../breakpoints';
import styled from 'styled-components';

const Contact = () => {
    return (
        <Wrapper>
            <div className="wrapper">
              <h4>Get in touch</h4>
              <div className="info-container">
                <div className="card-1">
                  <span className="line"></span>
                  <p className="title title-1">For general inquiries:</p>
                  <p className="details">matieu.ruth@gmail.com</p>
                </div>
                <div className="card-2">
                  <span className="line"></span>
                  <p className="title title-2">two</p>
                  <p className="details">rutm@gmail.com</p>
                </div>
                <div className="card-3">
                  <span className="line"></span>
                  <p className="title title-3">three</p>
                  <p className="details">rutm@gmail.com</p>
                </div>
              </div>
            </div>
        </Wrapper>
    )
}

export default Contact;

const Wrapper = styled.section`
  .wrapper {
    width: 100%;
    max-width: 1280px;
    overflow: hidden;
    margin: 0 auto;
    padding: 0;
    height: 40rem;
  }

  h4 {
    color: #544667;
    text-align: center;
    text-transform: uppercase;
    font-size: 2rem;
    font-weight: 600;
    text-align: center;
    padding: 8rem 0 2rem 0;
  }

  .info-container {
    display: grid;
    place-items: center;
    text-align: center;
  }

  .card-1, .card-2, .card-3 {
    padding-bottom: 4rem;
  }

  .title-1 {
    border-bottom: 5px solid #EEB462;
  }

  .title-2 {
    border-bottom: 5px solid #544667;
  }

  .title-3 {
    border-bottom: 5px solid #D07D78;
  }

  `
